import React, { Fragment, useEffect } from 'react';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
import ImmunizeItem from './ImmunizeItem';
import ImmunizeForm from './ImmunizeForm';
import { getImmunizes } from '../../actions/immunize';

const Immunizes = ({ getImmunizes, immunize: { immunizes } }) => {
  useEffect(() => {
    getImmunizes();
  }, [getImmunizes]);

  return (
    <Fragment>
      
      <ImmunizeForm />
      <div className="posts">
        {immunizes.map((immunize) => (
          <ImmunizeItem key={immunize._id} post={immunize} />
        ))}
      </div>
    </Fragment>
  );
};

Immunizes.propTypes = {
  getImmunizes: PropTypes.func.isRequired,
  immunize: PropTypes.object.isRequired
};

const mapStateToProps = (state) => ({
  immunize: state.immunize
});

export default connect(mapStateToProps, { getImmunizes })(Immunizes);
